import React, {memo} from 'react';
import styled from 'styled-components';

const SnsContainer = styled.div`
    background-color: #333333;
    width:100%;

    .snsWrap{
        max-width: 1200px;
        margin:0 auto;

        h1{
            font-size:28px;
        }
    }
`;

const Sns = memo(() => {
  return (
    <SnsContainer>
        <div className='snsWrap'>
            <h1><a href='https://kimhs7858.tistory.com/' target='_blank'>티스토리 블로그 (https://kimhs7858.tistory.com/)</a></h1>
        </div>
    </SnsContainer>
  );
});

export default Sns;
